@app.callback(
    Output('datatable-row-ids-container', 'children'),
    Input('datatable-row-ids', 'derived_virtual_row_ids'),
    Input('datatable-row-ids', 'selected_row_ids'),
    Input('datatable-row-ids', 'active_cell'))
def update_graphs(row_ids, selected_row_ids, active_cell):
    # based on the examples from https://dash.plotly.com/datatable/interactivity
    selected_id_set = set(selected_row_ids or [])
    
    if row_ids is None:
        dff = DMRsSig_df
        row_ids = DMRsSig_df["id"]#df['id']
    else:
        dff = DMRsSig_df.loc[row_ids]

    active_row_id = active_cell['row_id'] if active_cell else None
    
    
    series_DMRsNum = dff['EpiInd'].value_counts(ascending=True)
    fig_DMRsNum = px.bar(x=series_DMRsNum,
             y=series_DMRsNum.index,
             template = "ggplot2",
             title="Differentially methylated regions per sample",
             labels={
                     "x": "Number of DMRs",
                     "y": "Sample",
                 },
             )
    
    
    series_hyperHypoPie = dff['direction'].value_counts(ascending=True)
    fig_hyperHypoPie = go.Figure(data=[go.Pie(labels=series_hyperHypoPie.index,
                             values=series_hyperHypoPie,
                             textinfo='label+percent',
                             insidetextorientation='radial',
                             hole=.7,
                             title=" "
                            )])
    fig_hyperHypoPie.update_layout(annotations=[dict(text='Number of<br>Hyper and Hypo<br>methylated<br>DMRs', font_size=20, showarrow=False)])
    
    series_perChrm = dff['seqnames'].value_counts(ascending=True)
    fig_perChrm = go.Figure(data=[go.Pie(labels=series_perChrm.index,
                             values=series_perChrm,
                             hole=.7,
                             title=" "
                            )])
    fig_perChrm.update_layout(annotations=[dict(text='Number<br>of DMRs per<br>chromosome', font_size=20, showarrow=False)])
    
    series_AnnoContext = dff['Annotation'].value_counts(ascending=True)
    fig_AnnoContext = go.Figure(data=[go.Pie(labels=series_AnnoContext.index,
                             values=series_AnnoContext,
                             hole=.7,
                             title=" "
                            )])
    fig_AnnoContext.update_layout(annotations=[dict(text='Genomic<br>context', font_size=20, showarrow=False)])
    
    series_AnnoGeneType = dff['Gene Type'].value_counts(ascending=True)
    fig_AnnoGeneType = go.Figure(data=[go.Pie(labels=series_AnnoGeneType.index,
                             values=series_AnnoGeneType,
                             hole=.7,
                             title=" "
                            )])
    fig_AnnoGeneType.update_layout(annotations=[dict(text='Closest<br>gene type', font_size=20, showarrow=False)])
    
    x_grid = np.linspace(np.min(dff['Distance to TSS']), np.max(dff['Distance to TSS']), 1000) # this might get too slow, in that case lower this number to say 100
    kde = gaussian_kde(dff['Distance to TSS'], bw_method=0.05)
    kde = kde.evaluate(x_grid)
    df_closestTSS = pd.DataFrame.from_dict({"Distance to TSS":x_grid, "Kernel-density estimation":kde})
    fig_closestTSS = px.line(df_closestTSS,
                       y="Distance to TSS",
                       x="Kernel-density estimation",
                       height=850,
                       title="Distribution of the distance<br>to closest TSS",
                       template = "plotly_white")
    fig_closestTSS.update_traces(line=dict(color="Red", width=5))
    
    series_AnnoCGI = dff['WithinCpGIslan'].value_counts(ascending=True)
    fig_AnnoCGI = go.Figure(data=[go.Pie(labels=series_AnnoCGI.index,
                             values=series_AnnoCGI,
                             hole=.7,
                             title=" "
                            )])
    fig_AnnoCGI.update_layout(annotations=[dict(text='Within<br>CGI', font_size=20, showarrow=False)])
    
    series_AnnoPatMat = dff['PaternalOrMaternal'].value_counts(ascending=True)
    fig_AnnoPatMat = go.Figure(data=[go.Pie(labels=series_AnnoPatMat.index,
                             values=series_AnnoPatMat,
                             hole=.7,
                             title=" ",
                            )])
    fig_AnnoPatMat.update_layout(annotations=[dict(text='Paternal<br>or Maternal', font_size=20, showarrow=False)])
    
    return [dbc.Row([
                dcc.Graph(
                    id='fig_DMRsNum',
                    figure=fig_DMRsNum,),
                ]),
            dbc.Row([
                dbc.Col([
                    dcc.Graph(
                        id='fig_hyperHypoPie',
                        figure=fig_hyperHypoPie,)
                    ], md=6),
                dbc.Col([
                    dcc.Graph(
                        id='fig_perChrm',
                        figure=fig_perChrm,)
                    ], md=6),
                ]),
            dbc.Row([
                html.Hr(),
                html.H5("Annotation of differentially methylated regions:"),
                ]),
            dbc.Row([
                dbc.Col([
                    dbc.Row([
                        dbc.Col([
                            dcc.Graph(
                                id='fig_AnnoContext',
                                figure=fig_AnnoContext,)
                            ], md=6),
                        dbc.Col([
                            dcc.Graph(
                                id='fig_AnnoGeneType',
                                figure=fig_AnnoGeneType,)
                            ], md=6),
                        ]),
                    dbc.Row([
                        dbc.Col([
                            dcc.Graph(
                                id='fig_AnnoCGI',
                                figure=fig_AnnoCGI,)
                            ], md=6),
                        dbc.Col([
                            dcc.Graph(
                                id='fig_AnnoPatMat',
                                figure=fig_AnnoPatMat,)
                            ], md=6),
                        ]),
                    ], md=9),
                dbc.Col([
                    dcc.Graph(
                        id='fig_closestTSS',
                        figure=fig_closestTSS,
                    )], md=3,)
                ])
            ]

